import{_ as t,o as e,c as a,j as l,bv as U}from"./chunks/framework.nrF9sM7m.js";const R=JSON.parse('{"title":"更换笔记本CPU U2400测试","description":"","frontmatter":{"title":"更换笔记本CPU U2400测试","tags":["Acer","CPU","笔记本"],"id":943,"categories":["Digital"],"abbrlink":"7b92a8ff","date":"2007-06-16T08:56:41.000Z"},"headers":[],"relativePath":"Digital/更换笔记本CPU_U2400测试.md","filePath":"Digital/更换笔记本CPU_U2400测试.md","lastUpdated":1719711816000}'),i={name:"Digital/更换笔记本CPU_U2400测试.md"},o=l("p",null,[l("img",{src:U,alt:""})],-1),s=l("p",null,"笔记本用的是赛扬M处理器（注意是Celeron M，不是Mobile Celeron），主频1.6G、Yonah核心、1M的L2，性能上是非常不错的，而且老猫又不玩游戏的，所以足以应付日常工作，只是不支持SpeedStep技术，电池只能用一个半小时，相比之前的迅驰1代笔记本能用到3小时，差别是很大滴。",-1),M=l("p",null,"本来想换双核T2300、或L2400，但要7、8百元，对比单核T1300只要3百多，双核价格多了一倍而性能却不见得多一倍，本着追求性价比的消费观念，本来想还是不买双核了，然后在淘宝搜，发现ES版的U2400只要350，店主信誉还不错，只是有点担心ES版不稳定，但店主说很稳定而且7天包退，就买下了，周四收到U，花了半小时更换，用了2天，还是挺稳定的，速度也不错，测了2次电池，按上班正常操作，上网、写程序什么，从开机到自动休眠基本在2小时20分左右（设置了电量3%自动休眠），原以为超低电压的U2400电池能用3、4小时，看来还是有点差距的，可能跟大内存和无线网卡有点关系吧，不过多了近一个小时还是挺不错的。",-1),n=l("p",null,"换U之前运行了SuperPi，104万位是52秒，现在是71秒。开机比以前慢了一点，日常操作倒没明显差别，温度现在都在50℃下了，散热垫都用不着了。",-1),J=l("p",null,"目前本本配置如下：",-1),T=l("blockquote",null,[l("p",null,"型号：Acer 3642 芯片组：ATI X200M CPU：U2400 ES (933MHz, 2M, 533MHz) RAM：1G DDR2 * 2 (HY DDR2-533 + Kingmax DDR2-667) HardDisk：Toshiba60G (5400/8M) CD：Hitachi-LG Combo 其它：自己加了Atheros AR5005GS和蓝牙模块")],-1),_=[o,s,M,n,J,T];function r(d,c,p,I,y,D){return e(),a("div",{"data-pagefind-body":!0,"data-pagefind-meta":"base64:"},_)}const h=t(i,[["render",r]]);export{R as __pageData,h as default};
